from math import ceil
def count_number(n, x):
    return sum(x % a == 0 for a in range(ceil(x / n), n + 1))

def count_number(n, x):
    k = [1, x // n][x > n]
    return sum(1 for i in range(k, n + 1) if x/i == x//i and x/i in range(1, n + 1))

from math import ceil

def count_number(n, x):
    return sum((x%i == 0) and (x/i != i) + 1 for i in range(ceil(x/n), int(x**0.5)+1))
